import styles from "./Intro.module.css"

export default function Intro(){
   return(
    <div>
        <div className={styles.intro}>
            <div className={styles.intro_container}>
                <img className={styles.intro_logo} src={require("..//../assets/logo.png")} alt="logo"/>
                {/* <button className={styles.button_main}>Button 63</button> */}
                <button><img className={styles.intro_portal} src={require("..//../assets/portal.png")} alt="logo"/></button>
            </div>
        </div>
    </div>
   )
}
